import React, { useEffect, useState } from "react";
import { CardStyle } from './styles'
import AddCircleIcon from '@mui/icons-material/AddCircle';
import api from "../../Api";

interface Jogador {

    nome: string;
    idade: number;
    nacionalidade: string;
    clube: string;
    posicao: string;
    overall: number;
    foto: string;
    id: number;
}

function CardJogador() {

    const [jogadores, setJogadores] = useState<Jogador[]>();

    async function GetJogadores() {
        try {
            const res = await api.get<Jogador[], any>("/jogadores");
            setJogadores(res);
            console.log(jogadores);
            return res;
        } catch (err) {
            console.log(err)
        }
    }

    useEffect(() => {
        GetJogadores();
    },[]);


    return (
        <CardStyle>

            <div className="container">

                <div className="search">
                    <input type="text" placeholder="Pesquisar Jogador" />
                    <AddCircleIcon />
                </div>


                <div className="cards">

                    <div className="card">

                        <div className="image"><img src="" alt="" /></div>

                        <div className="infos">
                            <p id="nome">Nome:</p>
                            <p id="idade">Idade:</p>
                            <p id="nascionalidade">Nacionalidade:</p>
                            <p id="clube">Clube:</p>
                            <p id="posicao">Posição:</p>
                            <p id="over">Overall:</p>
                        </div>

                    </div>

                    <div className="card">

                        <div className="image"><img src="" alt="" /></div>

                        <div className="infos">
                            <p id="nome">Nome:</p>
                            <p id="idade">Idade:</p>
                            <p id="nascionalidade">Nacionalidade:</p>
                            <p id="clube">Clube:</p>
                            <p id="posicao">Posição:</p>
                            <p id="over">Overall:</p>
                        </div>

                    </div>

                    <div className="card">

                        <div className="image"><img src="" alt="" /></div>

                        <div className="infos">
                            <p id="nome">Nome:</p>
                            <p id="idade">Idade:</p>
                            <p id="nascionalidade">Nacionalidade:</p>
                            <p id="clube">Clube:</p>
                            <p id="posicao">Posição:</p>
                            <p id="over">Overall:</p>
                        </div>

                    </div>

                    <div className="card">

                        <div className="image"><img src="" alt="" /></div>

                        <div className="infos">
                            <p id="nome">Nome:</p>
                            <p id="idade">Idade:</p>
                            <p id="nascionalidade">Nacionalidade:</p>
                            <p id="clube">Clube:</p>
                            <p id="posicao">Posição:</p>
                            <p id="over">Overall:</p>
                        </div>

                    </div>

                </div>

            </div>

        </CardStyle>

    );
}

export default CardJogador;
